import React, { Component } from "react";
import Table from "react-bootstrap/Table";
import mssql from "../images/language-logos/mssql.png";
import mysql from "../images/language-logos/mysql.png";
import postgresql from "../images/language-logos/postgresql.png";
import powershell from "../images/language-logos/powershell.png";
import python from "../images/language-logos/python.png";
import javascript from "../images/language-logos/javascript.png";
import html from "../images/language-logos/html.png";
import css from "../images/language-logos/css.png";
import react from "../images/language-logos/react.png";
import node from "../images/language-logos/node.png";
import net from "../images/language-logos/net.png";
import java from "../images/language-logos/java.png";
import windows from "../images/os-logos/windows.png";
import linux from "../images/os-logos/linux.png";
import mac from "../images/os-logos/mac.png";
import netapp from "../images/os-logos/netapp.png";
import isilon from "../images/os-logos/isilon.png";

class Skills extends Component {
  state = {
    languages: [
      { id: 1, img: mssql, text: "Microsoft SQL", class: "skills-text red" },
      { id: 2, img: mysql, text: "MySQL", class: "skills-text red" },
      { id: 3, img: postgresql, text: "PostgreSQL", class: "skills-text red" },
      { id: 4, img: powershell, text: "PowerShell", class: "skills-text red" },
      { id: 5, img: net, text: "C#\\.NET", class: "skills-text blue" },
      { id: 6, img: java, text: "Java", class: "skills-text blue" },
      { id: 7, img: python, text: "Python", class: "skills-text" },
      { id: 8, img: node, text: "Node", class: "skills-text" },
      { id: 9, img: react, text: "React", class: "skills-text" },
      { id: 10, img: javascript, text: "JavaScript", class: "skills-text" },
      { id: 11, img: html, text: "HTML", class: "skills-text" },
      { id: 12, img: css, text: "CSS", class: "skills-text" }
    ],
    oss: [
      {
        id: 1,
        img: windows,
        text: "Windows" + "\xa0\xa0/" + "\xa0" + "  Windows Server",
        class: "skills-text red"
      },
      { id: 2, img: linux, text: "Linux", class: "skills-text blue" },
      { id: 3, img: mac, text: "Mac", class: "skills-text" },
      { id: 4, img: netapp, text: "NetApp", class: "skills-text" },
      { id: 5, img: isilon, text: "EMC", class: "skills-text blue" }
    ]
  };
  render() {
    return (
      <div className="skills-container">
        <div className="skills-legend">
          <p className="skills-level red">EXPERT </p>
          <p className="separator">|</p>
          <p className="skills-level blue"> ENTRY</p>
        </div>
        <div className="skills">
          <div className="skills-title">OPERATING SYSTEMS</div>
          <Table className="skills-os-table">
            <tbody>
              {this.state.oss.map(os => (
                <tr key={os.id} className="skills-row">
                  <td className="skills-image">
                    <img src={os.img} alt={os.text} />
                  </td>
                  <td className={os.class}>{os.text}</td>
                </tr>
              ))}
            </tbody>
          </Table>
          <div className="skills-title">LANGUAGES</div>
          <Table className="skills-language-table">
            <tbody>
              {this.state.languages.map(language => (
                <tr key={language.id} className="skills-row">
                  <td className="skills-image">
                    <img src={language.img} alt={language.text} />
                  </td>
                  <td className={language.class}>{language.text}</td>
                </tr>
              ))}
            </tbody>
          </Table>
          <div className="skills-title">OTHER SKILLS</div>
        </div>
      </div>
    );
  }
}

export default Skills;
